import React from "react";
import "./Form.css";

function NewForm() {
  const userName = "Username";
  const age = 'Age (years)';

  return (
    <div>
      <h2>{userName}</h2>
      <input type="text" />
      <h2>{age}</h2>
      <input type="number" />
      <button type="submit" className="formButton">Add user</button>
    </div>
  );
}

export default NewForm;
